import './Helper.css';


function Helper(){
const [number, setNumber] = React.useState(0);


    return(
        <div className="block">
            <div className="number">
                Счетчик: {number}
            </div>

            <div>
                <button onClick={OnIncrease} className="button">Increase</button>
                <button onClick={OnDecrease} className="button">Decrease</button>
            </div>
        </div>
    )
}

export default Helper
